import BingAdd from './components/BingAdd';
import BingQuery from './components/BingQuery';
import Header from './components/Header';
import Main from './components/Main';
import BingSearch from './components/api/BingSearch';
function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <BingSearch />
      <BingQuery />
      <BingAdd />

    </div>
  );
}

export default App;
